{
  "$schema": "https://biomejs.dev/schemas/1.9.4/schema.json",
  "vcs": {
    "enabled": false,
    "clientKind": "git",
    "useIgnoreFile": true
  },
  "files": {
    "ignoreUnknown": true,
    "ignore": ["dist", "*.json"]
  },
  "formatter": {
    "enabled": true,
    "lineWidth": 80,
    "useEditorconfig": true
  },
  "organizeImports": {
    "enabled": true
  },
  "linter": {
    "enabled": true,
    "rules": {
      "recommended": true,
      "suspicious": {
        "noExplicitAny": "off"
      }
    }
  },
  "javascript": {
    "formatter": {
      "quoteStyle": "single"
    }
  }
}

{
  "name": "nrm",
  "version": "2.0.1",
  "description": "npm registry manager can help you switch different npm registries easily and quickly",
  "bin": {
    "nrm": "dist/index.js"
  },
  "type": "commonjs",
  "repository": {
    "type": "git",
    "url": "git+https://github.com/Pana/nrm.git"
  },
  "files": [
    "dist"
  ],
  "scripts": {
    "clean": "rimraf node_modules dist",
    "test": "pnpm build && vitest run",
    "dev": "tsc --watch",
    "build": "rimraf dist && tsc && rimraf dist/types.js",
    "test:watch": "vitest",
    "changeset:version": "changeset version",
    "changeset:publish": "changeset publish",
    "check": "biome check --write --verbose"
  },
  "keywords": [
    "npm",
    "registry"
  ],
  "author": "Pana",
  "license": "MIT",
  "bugs": {
    "url": "https://github.com/Pana/nrm/issues"
  },
  "homepage": "https://github.com/Pana/nrm",
  "dependencies": {
    "@inquirer/checkbox": "^4.0.3",
    "@inquirer/select": "^4.0.2",
    "chalk": "4.1.2",
    "commander": "^8.3.0",
    "ini": "4.1.3",
    "open": "8.4.2",
    "undici": "5.28.2"
  },
  "devDependencies": {
    "@biomejs/biome": "1.9.4",
    "@changesets/cli": "^2.27.8",
    "@types/ini": "^4.1.1",
    "@types/node": "18",
    "coffee": "^5.4.0",
    "mock-fs": "^5.4.1",
    "rimraf": "^6.0.1",
    "strip-ansi": "^7.1.0",
    "typescript": "^5.7.2",
    "vitest": "2.1.6"
  },
  "engines": {
    "node": ">=18"
  }
}

